import React from "react";
import Card from "../UI/Card.js";
const BirthdayItem = () => {
    const date=new Date(2000,8,1);
    const name="rawan";
  return (
    <Card>
      <div>{date}</div>
      <div>{name}</div>
    </Card>
  );
};

export default BirthdayItem;
